import { CREATE_CURRENT_USER, 
         SAGA_GOOGLE_USER_START, 
         SAGA_EMAIL_USER_START,
         SAGA_GOOGLE_USER_SUCCESS,
         SAGA_GOOGLE_USER_FAILED,
         SAGA_EMAIL_USER_SUCCESS,
         SAGA_EMAIL_USER_FAILED } from './type';

export const createCurrentUser = user => ({
    type: CREATE_CURRENT_USER,
    payload: user
});

export const sagaGoogleUserStart = () => ({
    type: SAGA_GOOGLE_USER_START
});

export const sagaGoogleUserSUCCESS = (data) => ({
    type: SAGA_GOOGLE_USER_SUCCESS,
    payload: data
});

export const sagaGoogleUserFailed = (message) => ({
    type: SAGA_GOOGLE_USER_FAILED,
    payload: message
});

export const sagaEmailUserStart = emailAndpassword => {
    console.log('==============', emailAndpassword)
    return ({
        type: SAGA_EMAIL_USER_START,
        payload: emailAndpassword
    });
};

export const sagaEmailUserSuccess = (data) => ({
    type: SAGA_EMAIL_USER_SUCCESS,
    payload: data
});

export const sagaEmailUserFailed = (message) => ({
    type: SAGA_EMAIL_USER_FAILED,
    payload: message
});
